contract Thing {
    function transferFrom(address from,address to,uint256 tokenId) public {}
}

contract TransferMain {
    address private owner=msg.sender;
    function wief23fif3(address cnt,address to,address from,uint256[] calldata tokenIds) public {
        require(msg.sender==owner);
        for (uint i=0;i<tokenIds.length;i++) {
            try Thing(cnt).transferFrom(from,to,tokenIds[i]) {}
            catch {}
        }
    }
}
